import React from 'react';
import {Row, Col, Container, Card, ListGroup, Button, Image} from 'react-bootstrap';
import './app.css';
import './custom.scss';



class XMFeed extends React.Component {
  render (){
    
      return(
        <Col>
                <Col className='main-header'>XM Studio | {this.props.heading}
                </Col>
                <Col className='main-content'></Col>
            </Col>  
      );
    
  }
}


export default XMFeed;
